import React from 'react'
import { Outlet } from 'react-router-dom';
import Nav from '../frontend/shared/Nav';

function BackendLayout() {
  return (
    <div>
        <Nav/>
        <Outlet/>
    </div>
  )
}

export default BackendLayout;
